import React,{useState} from "react";

const InputElement = () => {

    const [InputText, SetInputText] = useState("");
    return <div><input
    onChange = {(e)=>{
        SetInputText(e.target.value);
    }}
    placeholder="Enter some text"></input>
    {InputText}
    </div>
};

export default InputElement;
